#!/usr/bin/python3

import re
import sys
import time
from base64 import b64decode
from subprocess import run, CalledProcessError
from threading import Thread
from urwid.display.raw import Screen as UrwidScreen


ESC_MOVE_BEGINNING = '\x1b[0G'
ESC_MOVE_UP = '\x1b[{n}A'
ESC_MOVE_DOWN = '\x1b[{n}B'

# an embedded FLAC file we're handing over to sox' `play` later
NOTIFICATION_SOUND = b64decode(b'')


def play_notification_sound_target():
    try:
        run(('play', '-q', '-'), input=NOTIFICATION_SOUND)
    except CalledProcessError:
        pass

def play_notification_sound():
    Thread(target=play_notification_sound_target).start()


class Timer:
    def __init__(self, timer):
        self._timer = timer
        self._target_time = time.time() + timer['length']

    def add(self, d):
        self._target_time += d

    def format(self):
        d = self._target_time - time.time()
        return (d <= 0, '{} - {}'.format(self._format_time(d), self._timer['name']))

    def _format_time(self, time_):
        if time_ < 0:
            time_ = 0
        minutes = int(time_ // 60)
        seconds = int(time_ % 60)
        return '{:02d}:{:02d}'.format(minutes, seconds)

    def send_notification(self):
        try:
            name = re.sub(r'\x1b\[\d+m', '', self._timer['name'])
            run(('notify-send', '-a', 'puchidoro', f'{name} started', f'Duration: {self._format_time(self._timer['length'])}'))
            play_notification_sound()
        except CalledProcessError:
            pass

screen = UrwidScreen()
screen.set_input_timeouts(0.25)

timers = [
    { 'length': 1500, 'name': '\x1b[91mPomodoro\x1b[0m' },
    { 'length': 300, 'name': '\x1b[92mShort break\x1b[0m' },
    { 'length': 1500, 'name': '\x1b[91mPomodoro\x1b[0m' },
    { 'length': 300, 'name': '\x1b[92mShort break\x1b[0m' },
    { 'length': 1500, 'name': '\x1b[91mPomodoro\x1b[0m' },
    { 'length': 300, 'name': '\x1b[92mShort break\x1b[0m' },
    { 'length': 1500, 'name': '\x1b[91mPomodoro\x1b[0m' },
    { 'length': 1800, 'name': '\x1b[94mLong break\x1b[0m' }
]
current_timer_index = 0
current_timer = Timer(timers[current_timer_index])
pause_time = None

print('\n\n')  # initial newline
while True:
    # print timer
    timer_done, timer_repr = current_timer.format()
    if pause_time is not None:
        timer_repr = ''
    print(ESC_MOVE_UP.format(n=3) + timer_repr)
    if pause_time is not None:
        print('\n(Q)uit   Un(p)ause timer')
    else:
        print('\n(Q)uit   (P)ause timer  ')

    # use urwid's Screen class to get keyboard input
    with screen.start():
        keys = screen.get_input(False)

    for key in keys:
        if key == 'q':
            sys.exit(0)
        elif key == 'p':
            if pause_time is not None:
                current_timer.add(time.time() - pause_time)
                pause_time = None
            else:
                pause_time = time.time()

    # advance timer
    if timer_done and pause_time is None:
        current_timer_index = (current_timer_index + 1) % len(timers)
        current_timer = Timer(timers[current_timer_index])
        current_timer.send_notification()
        print(ESC_MOVE_UP.format(n=1) + ' ' * 24 + ESC_MOVE_DOWN.format(n=1))
        if current_timer_index == 0:
            print()
